import React from 'react';

const App = () => {
    const [num, setNum] = (0);
      const inNum = () =>{
        setNum(num + 1);
      }

      const deNum = () => {
        if(num > 0){
          setNum(num - 1);
        }else{
          alert('sorry, Zero Limit Reached')
          setNum(0);
        }

      };
  return(
    <>
     <div className='main_div'>
      <div className='center_div'>
        <h1> {num}</h1>
        <div className='btn_div'>
          <button onClick={inNum}>
            Increment
          </button>
          <button onClick={deNum}>
            Decrement
          </button>
        </div>
      </div>
     </div>
    </>
  )

};
export default App;
